def flux1(n):
  xpts = np.linspace(0, a+b, n+1)
  phi1 = []
  for x in xpts:
    if (x < a):
      phi1.append(C2 * cosh(x/L1C) + C3)
    else:
      phi1.append(C4 * sinh((a+b-x)/LM))

  return xpts, phi1

