  xpts = np.linspace(0, a+b, n+1)
  phi2 = []
  for x in xpts:
    if (x < a):
      phi2.append(C5 * sinh(x/L2C)+C6*cosh(x/L2C)+C7*cosh(x/L1C)+C8*sinh(x/L1C)+C9)
    else:
      phi2.append(C10*sinh(x/L2M)+C11*cosh(x/L2M)+C12*cosh((a+b-x)/LM)+C13*sinh((a+b-x)/LM))

  return xpts, phi2
